import React, { Component } from 'react';
import { Card, CardTitle, CardActions, CardText, Button, CardMenu, IconButton } from 'react-mdl';

class About extends Component {
    render() {
        return(
            <div className="aboutme-div">
            <Card className="aboutme-card"shadow={2} style={{width: '1012px', margin: 'auto'}}>
                <CardTitle style={{color: '#fff', height: '300px', background: 'url(http://www.getmdl.io/assets/demos/welcome_card.jpg) center / cover'}}>Welcome to My Portfolio Page</CardTitle>
                <CardText style={{margin: 'auto', textAlign: 'left', display:'box'}}>
                    My name is Kyle and I am a recent graduate from San Diego State University with a B.S. in Computer Science.
                    <br></br>
                    Additionally, I have 3 years of Information Technology Support experience in the public sector. I enjoy 
                    creating projects such as this website and my personal home-lab which this website is run on. I am currently seeking job opportunities
                    in the IT and Cyber Secruity fields. If you would like to get in touch with me, please do not hesitate to click the button below for my contact, 
                    or check out my resume and projects.
                    <br></br>
                    Thanks for stopping by!
                </CardText>
                <CardActions border>
                    <Button colored>Contact</Button>
                </CardActions>
            </Card>
            </div>
        )
    }
}

export default About;
